// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.2 <0.9.0;

interface ICommonFunctions {
    enum BusStatus { Waiting, Approved, Rejected, Noted, ForwardToCoordinator , ForwardToHTMC }

    struct BusItem {
        uint256 id;
        uint256 model;
        string vim_number;
        uint256 company_number;
        string plate_number;
        uint256 expire_date;
        BusStatus status;
        address owner;
        address creator;
    }

     // Event declaration
    event BusCreated(
        uint256 id,
        uint256 model,
        string vim_number,
        uint256 company_number,
        string plate_number,
        uint256 expire_date,
        BusStatus status,
        address owner,
        address creator
    );

    function addBus(uint256 _model, string memory _vim_number, uint256 _company_number, string memory _plate_number) external;
    function getBusData(uint256 id) external view returns (BusItem memory);
    function updateBusStatus(uint256 id, BusStatus newStatus) external;
    function forwardBusToCoordinator(uint256 busToForwardId) external;
    function getAllSentToCoordinator() external view returns (BusItem[] memory);
    function setCoordinatorAddress(address _newCoordinatorContractAddress) external;
    function getSingleBus(uint256 id) external view returns (BusItem memory);
}
